import React from "react";
import "./Nav.css";

function Nav() {
  return (
    <div className="navbar">
      <div className="logo-container">
        <h1>Ankur</h1>
      </div>
      <div className="nav-items-container">
        <ul className="nav-items">
          <li>
            <a href="/work">Work</a>
          </li>
          <li>
            <a href="/about">About</a>
          </li>
          <li>
            <a href="/contact">Contacts</a>
          </li>
        </ul>
      </div>
    </div>
  );
}

export default Nav;
